import React from 'react';

import './Button.css';

const Button = props => {
  const handleEnter = (e) => {
    if(e.key === 'Enter') {
      return props.onClick
    }
  }
  return (
    <button type={props.type} className="button" onClick={props.onClick} onKeyPress={handleEnter}>
      {props.children}
    </button>
  );
};

export default Button;
